import Card from "../UI/Card";

const ContactList = () => {
  return (
    <Card className="contact-list">
      <ul>
        <li className="list-item">
          <div>Ariful</div>
          <div>Ariful</div>
          <div>
            <span>Del</span>
            <span>Add</span>
          </div>
        </li>
      </ul>
    </Card>
  );
};

export default ContactList;
